import React from 'react';

// import styles from './Specialties.module.css';

import Specialty from './Specialty';

const SPECIALTY_LIST = [
    {
        title: 'Meditation',
        description: 'Specializing in Medical Meditations',
        details: '',
    },
    {
        title: 'Yoga',
        description: '200RYT. Specializing in Hatha Yoga and Beginner Yoga',
        details: 'My beginner classes focus on the fundamentals and create a strong foundation for your practice. Perfect for beginners or those who have been away from their practice for some time, I teach these classes with precise cues and the use of props.',
    },
    {
        title: 'Aerial Yoga',
        description: 'Certified Aerial Yoga Instructor',
        details: 'My aerial classes are taught at a beginner level and are a foundational practice perfect for those new to Aerial Yoga. I help you bring balance to your body using aerial silks to work gravity, create space in joints, and lengthen muscles.',
    },
    {
        title: 'Holistic Health',
        description: 'Certified Holistic Health Educator Specializing in Ayurveda',
        details: '',
    },
]

const Specialties = () => {
    return (
        <div>
            {
                SPECIALTY_LIST.map(specialty => (
                    <Specialty specialty={specialty} />
                ))
            }
        </div>
    )
}

export default Specialties;
